import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import './index.js';
import { useState, useEffect } from 'react';
import './App.css';

let count = 0;
import '../../src/App.css';
export const Feed = () => {
    let count = 0;
    const [counter, setCounter] = useState(count);
    const increase=()=>{
        count++;
        ReactDOM.render (
            <div className='feed'>
            <h2 >{count}</h2>
            <button className='button' onClick={increase}>+</button>
            </div>
        );

    }
    ReactDOM.render (
        <div className='feed'>
        <h2 >{count}</h2>
        <button className='button' onClick={increase}>+</button>
        </div>
    );
}
export default Feed;
ReactDOM.render(
        <div className='feed'>
        <h2 >{count}</h2>
        <button className='button'>+</button>
        </div>
        ,
        document.getElementById('root')
    );
